script: |
  super -f text -I q11745.spq | sort > q11745.out

inputs:
  - name: q11745.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT col1 BETWEEN ( - + col0 + + col1 - CAST ( NULL AS INTEGER ) + + col0 * col2 ) AND col0;
  - name: tab2

outputs:
  - name: q11745.out
    data: |
      46	51	23
      64	77	40
